import React from 'react'

function ServicesHome() {
  return (
    <div className='w-full h-[500px] py-10 px-10 bg-[#F1F8FF]'>
         <div className='max-w-[2000px] w-full h-screen mx-1000 px-200  text-left  justify-center mx-auto grid md:grid-cols-2'>
          <h1 className='text-4xl text-black font-semibold mx-20'>Our Services</h1>
          <button className='bg-[#1D5ADE] w-[700px] rounded-full font-medium   text-white'>View all Services</button>
         </div>
         {/* <div>
         <button className='bg-[#1D5ADE] w-[200px] rounded-full font-medium  my-5 py-3 px-3 mx-3 text-white'>View all Services</button>
         </div>
       */}
    </div>
  )
}

export default ServicesHome
